;; @@
(let [Pyeom (map second yeom)
      Phong (map second hong)
      Lyeom (doquery :ipmcmc blind-joint-eval [Pyeom (second Ts)])
      Lhong (doquery :ipmcmc blind-joint-eval [Phong (first Ts)])
      Syeom (map :result (take 100 (take-nth 10 (drop 1000 Lyeom))))
      Shong (map :result (take 100 (take-nth 10 (drop 1000 Lhong))))
      Vyeom (float (/ (reduce + Syeom) (count Syeom)))
      Vhong (float (/ (reduce + Shong) (count Shong)))]
 [Vhong Vyeom])
