(def scatter-points
  (map (fn [entry] [[(* (first Ts) (second (first entry)))
                     (* (second Ts) (second (second entry)))]  ; x: 홍문종, y: 염동열, z: 소속정당
                    (second (nth party-info (index-of (first (first entry)) members)))])
    (map vector hong yeom)))
(def plots
  (map
    (fn [x] (plot/list-plot [(first x)] :color ((keyword (second x)) color-map)
                            :plot-range [[0 1] [0 1]] :symbol-size 10 :opacity 0.65))
      scatter-points))

(apply plot/compose plots)
